                        "Are you absolutely sure you want to DELETE this member? They will no longer be able to log in. This action cannot be undone! (The member will not be notified of this change.)": ["هل أنت متأكد تمامًا من أنك تريد حذف هذا العضو؟ لن يتمكن بعد الآن من تسجيل الدخول. لا يمكن التراجع عن هذا الإجراء! (لن يتم إعلام العضو بهذا التغيير.)"],
                        "Are you absolutely sure you wish to delete this blog post? This action is PERMANENT!": ["هل أنت متأكد تمامًا من رغبتك في حذف منشور المدونة هذا؟ هذه العملية نهائية!"],
                        "Are you sure you want to delete this spec type?": ["هل أنت متأكد أنك تريد حذف هذا النوع من المواصفات؟"],
                        "Are you sure you want to disable Live Chat? The chat box will no longer be displayed in this site. You can turn this back on at anytime.": ["هل أنت متأكد أنك تريد تعطيل  خاصية الدردشة المباشرة؟ لن يتم عرض مربع الدردشة في هذا الموقع بعد الآن. يمكنك إعادة تشغيلها  في أي وقت."],
                        "Are you sure you want to go back?": ["هل أنت متأكد أنك تريد العودة للوراء؟"],
                        "Are you sure you want to regenerate recovery codes? The old codes will no longer be effective.": ["هل أنت متأكد أنك تريد إعادة إنشاء رموز الاسترداد؟ الرموز القديمة لن تكون فعالة بعد الآن."],
                        "Are you sure you want to remove the Blog section from your site? All of your blog posts and settings will be kept. Just add the section back to bring them back!": ["هل أنت متأكد أنك تريد إزالة قسم المدونة من موقعك؟ سيتم الاحتفاظ بجميع منشورات المدونة والإعدادات الخاصة بك. فقط أضف القسم مرة أخرى لإعادتهم!"],
                        "Are you sure you want to remove the Product Showcase section from your site? All of your products and settings will be kept. Just add the section back to bring them back!": ["هل أنت متأكد من أنك تريد إزالة قسم عرض المنتج من موقعك؟ سيتم الاحتفاظ بجميع المنتجات والإعدادات الخاصة بك. فقط أضف القسم مرة أخرى لإعادتهم!"],
                        "Are you sure you want to remove the Store section from your site? All of your products and settings will be kept. Just add the section back to bring them back!": ["هل أنت متأكد أنك تريد إزالة قسم المتجر من موقعك؟ سيتم الاحتفاظ بجميع المنتجات والإعدادات الخاصة بك. فقط أضف القسم مرة أخرى لإعادتهم!"],
                        "Are you sure you want to remove the password for this page? This page will be public for all visitors.": ["هل أنت متأكد أنك تريد إزالة كلمة المرور لهذه الصفحة؟ هذه الصفحة ستكون عامة لجميع الزوار."],
                        "Are you sure you want to reset this member's password? They will receive an email to optionally reset their password.": ["هل أنت متأكد أنك تريد إعادة تعيين كلمة مرور هذا العضو؟ سيتلقون بريدًا إلكترونيًا لإعادة تعيين كلمة المرور الخاصة بهم اختياريًا."],
                        "Are you sure you want to set %{pageTitle} as the new homepage? The password for this page will be removed.": ["هل أنت متأكد من أنك تريد تعيين %{pageTitle} كصفحة رئيسية جديدة؟ ستتم إزالة كلمة المرور لهذه الصفحة."],
                        "Are you sure you want to set a password for this page? Visitors must enter the password to see the page content.": ["هل أنت متأكد أنك تريد تعيين كلمة مرور لهذه الصفحة؟ يجب على الزوار إدخال كلمة المرور لرؤية محتوى الصفحة."],
