                        "Are you sure you wish to change your Audience Plan? Starting %{startDate}, your Audience Plan will change to $%{pricing}/%{period}.": ["هل أنت متأكد من رغبتك في تغيير خطة المتابعين الخاصة بك؟ بدءًا من %{startDate} ، ستتغير خطة الجمهور إلى $%{pricing} / %{period} ."],
