                        "Dashboard|I will NOT buy search engine advertising, trademarks or domain names that mention or use “Strikingly” or other Strikingly logos and I will NOT engage in any fraudulent, spam or low quality marketing activities such as those outlined in the [link: Strikingly Affiliate Program Agreement].": ['لن أشتري إعلانات محرك البحث أو العلامات التجارية أو أسماء المجالات التي تذكر أو تستخدم شعارات "Strikingly" أو غيرها من الشعارات Strikingly ولن أشارك في أي أنشطة تسويقية احتيالية أو غير مرغوب فيها أو منخفضة الجودة مثل تلك الموضحة في [link: اتفاق برنامج انتساب Strikingly.]'],
                        "Dashboard|I will NOT make deceptive or misleading claims, guarantee earnings, or promise a prospective client success. I will NOT use the following phrases or phrases similar to the following: “Take my course and make money on Strikingly” or “Launch your store and earn money immediately”.": ['لن أقدم مطالبات خادعة أو مضللة أو أضمن الأرباح أو أعدك بنجاح العميل المحتمل. لن أستخدم العبارات أو العبارات التالية المشابهة لما يلي: "خذ الدورة التدريبية الخاصة بي واكسب المال من Strikingly" أو "ابدأ متجرك واكسب المال على الفور".'],
                        "Dashboard|I will NOT use promotional means that contain objectionable content, including but not limited to content that is fraudulent, misleading, libelous, defamatory, obscene, violent, bigoted, hate-oriented, illegal, and/or promoting illegal goods, services or activities.": ["لن أستخدم الوسائل الترويجية التي تحتوي على محتوى مرفوض ، بما في ذلك على سبيل المثال لا الحصر المحتوى الاحتيالي و / أو المضلل و / أو التشهيري و / أو الفاحش و / أو العنيف والمتعصب والموجّه للكراهية وغير القانوني و / أو الذي يروج لسلع أو خدمات أو أنشطة غير مشروعة."],
                        "Dashboard|I will be honest, ethical, and transparent when I talk about Strikingly. As a Strikingly Affiliate, I will follow the [link: Federal Trade Commission Disclosure Guidelines] (or equivalent disclosure guidelines for your region) and make it clear that I am promoting Strikingly as an affiliate.": ["سأكون صادقًا وأخلاقيًا وشفافًا عندما أتحدث عن Strikingly. بصفتي شريكًا Strikingly، سأتبع [link: إرشادات الإفصاح عن لجنة التجارة الفيدرالية] (أو إرشادات إفصاح مماثلة لمنطقتك) وأوضح أنني أروج Strikingly كمنتسب."],
                        "Dashboard|I will use Strikingly’s brand assets according to the [link: Strikingly Brand Guidelines].": ["سأستخدم أصول علامة Strikingly التجارية وفقًا لـ [link: إرشادات العلامة التجارية Strikingly]."],
