                        "Dashboard|Thank you for being a Strikingly Affiliate! Please send us any comments or suggestions to make our Affiliate Program better. We read every message!": ["شكرًا لك على كونك أحد شركاء Strikingly! يرجى إرسال أي تعليقات أو اقتراحات إلينا لتحسين برنامج الانتساب الخاص بنا. نقرأ كل رسالة!"],
                        "Dashboard|Thank you for submitting your tax information and signed tax forms. We'll send you an email (to %{var1}) once your profile is reviewed, which may take a few business days. After approval, you will be able to request payouts for approved commissions.": ["شكرًا لك على إرسال معلوماتك الضريبية ونماذج الضرائب الموقعة. سنرسل إليك بريدًا إلكترونيًا (إلى %{var1}) بمجرد مراجعة ملفك الشخصي ، الأمر الذي قد يستغرق بضعة أيام عمل. بعد الموافقة ، ستتمكن من طلب دفعات للعمولات المعتمدة."],
