                        "Dashboard|The TIN is either a SSN/ITIN (for individuals) or an EIN (for businesses).": ["رقم التعريف الضريبي (TIN) هو إما رقم SSN / ITIN (للأفراد) أو رقم تعريف شخصي (EIN) (للأعمال)."],
