                        "Domain|We are persistently checking your domain connection. This can take up to 48 hours. We’ll update you the result via email.": ["نحن نتحقق باستمرار من ارتباط نطاقك. قد يستغرق الأمر إلى 48 ساعة. سنقوم بإعلامك بالنتيجة عبر البريد الإلكتروني."],
