                        "Domain|We partner with ICANN accredited registrar OpenSRS.com to make domain registration easy for you. We respect [link: your rights as a domain owner]": ["نحن شركاء مع OpenSRS.com المسجل المعتمد لدى ICANN لتسهيل عملية تسجيل النطاق بالنسبة لك. نحن نحترم [link: حقوقك بصفتك مالك نطاق ]"],
                        "Domain|We strongly recommend enabling auto-renewal to avoid losing your domain.": ["نوصي بشدة تفعيل التجديد التلقائي لتجنب فقدان المجال الخاص بك."],
                        "Domain|We strongly recommend that you enable auto-renewal. Missing a domain’s renewal window will disrupt service for all websites and emails connected to that domain. Are you sure you want to disable auto-renewal for your domain?": ["نوصي بشدة تفعيل  التجديد التلقائي. سيؤدي فقدان نافذة تجديد النطاق إلى تعطيل الخدمة لجميع مواقع الويب ورسائل البريد الإلكتروني المتصلة بهذا النطاق. هل أنت متأكد من أنك تريد تعطيل التجديد التلقائي لنطاقك؟"],
                        "Domain|We'll be conducting domain maintenance on %{var1}. During this time, your existing domains will function as usual, but other domain services will be temporarily unavailable, including purchases, renewals, transfers, etc.": ["سنجري صيانة للنطاق على %{var1}. خلال هذه الفترة، ستعمل نطاقاتك الحالية كالمعتاد، ولكن خدمات النطاقات الأخرى لن تكون متاحة مؤقتًا، بما في ذلك عمليات الشراء والتجديد والتحويلات وما إلى ذلك."],
                        "Domain|We'll bill this purchase with the card you have on file (last four digits: %{fd})": ["سنقوم بفوتورة هذا الشراء بالبطاقة المسجلة لديك (الأرقام الأربعة الأخيرة: %{fd})"],
                        "Domain|We'll bill this transfer with the card you have on file (last four digits: %{fd})": ["سنقوم بفوتورة هذا النقل بالبطاقة المسجلة لديك (الأرقام الأربعة الأخيرة: %{fd})"],
                        "Domain|When applying for an ICP filing number in the Aliyun ICP filing management system, you will need a filing service number to associate your domain and Aliyun server. The filing service number is only valid for one week.": ["When applying for an ICP filing number in the Aliyun ICP filing management system, you will need a filing service number to associate your domain and Aliyun server. The filing service number is only valid for one week."],
