                        "Domain|You are using custom code. If you disconnect your custom domain,[strong: for security reasons, your site will be unpublished.]": ["أنتم تستخدمون كوداً مخصصاً. إذا قمتم بإلغاء ربط نطاقك المخصص [strong:فسيتم إلغاء نشر موقعكم لأسباب أمنية.]"],
