                        "Domain|ZIP/Postal code is invalid.": ["الرمز البريدي غير صالح."],
                        "Domain|Zip code": ["الرمز البريدي"],
                        "Domain|[placeholderStrong1: You'll be billed $%{price} immediately] for your domain but [placeholderStrong2: will be credited $24.95] for the first payment of your Strikingly %{plan}.": ["%{plan} Strikingly  للدفعة الأولى من   [placeholderStrong2: ستُضاف 24.95$ لرصيدك]  من اجل نطاقك ولكن   [placeholderStrong1: $%{price} ستتم محاسبتك فورًا على]"],
                        "Domain|[placeholderStrong1: You'll be billed $%{price} immediately] for your domain.": ["[placeholderStrong1: ستتم محاسبتك على $%{price} فورًا ] من اجل نطاقك"],
                        "Domain|[placeholderStrong: You just got a new domain!]": ["[placeholderStrong: لقد حصلت للتو على نطاق جديد! ]"],
                        "Domain|[strong:Important]: There is no refund when you delete an .AT domain.": ["[strong: هام]: لا يتم استرداد الأموال عند حذف نطاق .AT."],
                        "Domain|[strong:Note:] If you change the name, organization, or email, we are required by policy to impose a 60-day transfer lock. This lock means that you will not be able to transfer this domain (%{var1}) to another registrar for a period of 60 days after the change.": ["[strong: ملاحظة:] إذا قمتم بتغيير الاسم أو المؤسسة أو البريد الإلكتروني، فنحن مطالبون بموجب السياسة العامة بفرض قفل النقل لمدة 60 يوماً. أي أنكم لن تتمكنون من نقل هذا النطاق (%{var1}) إلى مسجل آخر لمدة 60 يوماً بعد التغيير."],
                        "Domain|[strong:Registrant Requirement:] For .eu domains, registrant must have a valid address in the European Union.": ["[strong:متطلبات المسجّل:] بالنسبة إلى النطاقات المنتهية بـ .eu ، يجب أن يكون للمسجّل عنوان صالح في الاتحاد الأوروبي."],
                        "Domain|[strong:Registrant Requirement:] Registrant contact address and phone number must be in Japan.": ["[strong:متطلبات المسجّل:] يجب أن يكون عنوان اتصال ورقم هاتف المسجّل في اليابان."],
                        "Domain|[strong:Registrant Requirement:] Registrant must be a business entity, not an individual, and must be located in Ireland.": ["[strong:متطلبات المسجل:] يجب أن يكون المسجل كيانًا تجاريًا، وليس فردًا، ويجب أن يكون موجودًا في أيرلندا."],
                        "Domain|[strong:Registrant Requirement:] Registrant must be a resident in the European Union, Switzerland, Norway, Iceland or Liechtenstein.": ["[strong:متطلبات المسجّل:] يجب أن يكون المسجّل مقيماً في الاتحاد الأوروبي، أو سويسرا، أو النرويج، أو أيسلندا، أو ليختنشتاين."],
                        "Domain|[strong:Registrant Requirement:] The owner must be a Malaysian citizen or a non-Malaysian residing in Malaysia.": ["[strong: متطلبات المسجل:] يجب أن يكون المالك مواطناً ماليزياً أو غير ماليزي مقيم في ماليزيا."],
                        "Domain|[strong:Registrant Requirement:] The owner must be a legal entity incorporated in Malaysia.": ["[strong: متطلبات المسجل:] يجب أن يكون المالك كياناً قانونياً مؤسساً في ماليزيا."],
                        "Domain|[strong:Registrant Requirement:] The registrant contact must be based in Malaysia.": ["[strong: متطلبات المسجل:] يجب أن يكون مقر جهة الاتصال في ماليزيا."],
                        "Domain|[strong:Registrant Requirement:] You must choose a registrant type and fill in the owner information.": ["[strong: متطلبات المسجل:] عليك اختيار نوع المسجل وملأ معلومات المالك."],
                        "Domain|[strong:Registrant Requirement:] You must choose an Entity Type for the Canadian Presence Requirements and agree to the terms of the CIRA Registrant Agreements.": ["[strong:متطلبات المسجّل:] يجب عليك اختيار نوع الجهة لتلبية متطلبات الحضور الكندي وشروط اتفاقيات الـCIRA للمُسجلين."],
                        "Domain|[strong:Registrant Requirement:] You must choose an application purpose and a residency status in Owner Information.": ["[strong:متطلبات المسجل:] يجب عليك اختيار غرض الطلب وحالة الإقامة في معلومات المالك."],
                        "Domain|[strong:Transfer Requirement:] For .uk domain transfer, you need to contact your existing registrar's support system and send them the following instructions to request a domain tag change:": ["[strong: متطلبات النقل:] بالنسبة لنقل نطاق .uk، عليك التواصل مع خدمة الدعم لمسجلك الحالي وإرسال التعليمات التالية إليهم لطلب تغيير علامة النطاق:"],
                        "Domain|[var1:Registrant Requirement:] Registrant must provide eligibility and registrant information in the owner information card and must have a valid Australian address.": ["[var1: متطلبات المُسجل:] يجب على المُسجل تقديم معلومات الأهلية والمُسجل في بطاقة معلومات المالك ويجب أن يكون لديه عنوان أسترالي صالح."],
