                        "Ecommerce|The World": ["العالم"],
                        "Ecommerce|The acquiring bank's system has reported an error. Please try again later.": ["أبلغ نظام البنك المتلقي عن خطأ. الرجاء معاودة المحاولة في وقت لاحق."],
                        "Ecommerce|The content format of this CSV file is incorrect. Please use CSV template and do not change any structure.": ["تنسيق محتوى ملف CSV هذا غير صحيح. الرجاء استخدام نموذج CSV وعدم تغيير أي بنية."],
