                        "Ecommerce|The field is not valid": ["الحقل غير صالح"],
                        "Ecommerce|The first option will be the default selected option during checkout. To change this, drag another option to be first.": ["سيكون الخيار الأول هو الخيار الافتراضي المحدد أثناء الدفع. لتغيير هذا ، اسحب خيارًا آخر ليكون الأول."],
                        "Ecommerce|The issuing bank has refused the transaction. Please contact the issuing bank.": ["رفض المصرف المُصدِر المعاملة. يرجى الاتصال بالبنك المصدر."],
                        "Ecommerce|The issuing bank requires a response (call bank).": ["يطلب البنك المُصدر ردًا ( اتصل بالبنك)."],
                        "Ecommerce|The minimum transaction amount of each order is NT$30": ["الحد الأدنى لمبلغ المعاملة لكل طلب هو 30 دولارًا تايوانيًا جديدًا"],
                        "Ecommerce|The order cannot be placed due to payment error. Payments in HRK are no longer accepted. Please wait for store owner to update store currency.": ["لا يمكن تقديم الطلب بسبب خطأ في الدفع. لم تعد تُقبل المدفوعات بعملة الكونا الكرواتية. يرجى الانتظار حتى يقوم صاحب المتجر بتحديث عملة المتجر."],
                        "Ecommerce|The payment is being settled. Please try again later.": ["جاري تسوية الدفعة. الرجاء معاودة المحاولة في وقت لاحق."],
                        "Ecommerce|The product review feature is only available for sites with custom domains. [link:Go to connect Custom Domains]": ["ميزة مراجعة المنتج متاحة فقط للمواقع ذات النطاقات المخصصة. [link: اذهب للاتصال بالمجالات المخصصة]"],
                        "Ecommerce|The refund has failed due to an error from your payment gateway (%{var1}). Please check your payment account for more information. (Error: %{var2})": ["فشلت عملية الاسترداد بسبب خطأ ببوابة الدفع الخاصة بك ( %{var1}). المرجو التحقق من حساب الدفع الخاص بك للمزيد من المعلومات. (خطأ: %{var2})"],
                        "Ecommerce|The refund has failed due to an error from your payment gateway (Strikingly Taiwan Payments). Please contact support for more assistance. (Error: %{var1})": ["فشلت عملية الاسترداد بسبب خطأ ببوابة الدفع الخاصة بك (Strikingly Taiwan Payments). المرجو التواصل مع فريق الدعم للمساعدة.(خطأ: %{var1})"],
                        "Ecommerce|The refund has failed due to an internal error. Please contact support for more assistance.": ["فشلت عملية الاسترداد بسبب خطأ داخلي. المرجو التواصل مع فريق الدعم للمساعدة."],
                        "Ecommerce|The registration documents below have failed validation. Please check your email for more instructions and resubmit these required documents.": ["فشلت وثائق التسجيل أدناه لعدم صلاحياتها. يرجى التحقق من بريدك الإلكتروني لمزيد من التعليمات وإعادة تقديم المستندات المطلوبة."],
                        "Ecommerce|The server of the National Credit Card Center of R.O.C. is unavailable. Please try again later.": ["خادم المركز الوطني لبطاقات الائتمان في R.O.C. غير متوفر. الرجاء معاودة المحاولة في وقت لاحق."],
                        "Ecommerce|The transaction was either declined by the processor or bank, or it can't be used for this payment. Please check the payment account for abnormalities.": ["إما تم رفض المعاملة من قبل المعالج أو البنك ، أو لا يمكن استخدامها لهذه الدفعة. يرجى التحقق من حساب الدفع بحثًا عن أي خلل."],
                        "Ecommerce|There are no products under this category yet.": ["لا توجد منتجات تحت هذه الفئة حتى الآن."],
                        "Ecommerce|There has been an error processing your payment. Please check and retry.": ["كان هناك خطأ في معالجة الدفع الخاص بك. يرجى التحقق وإعادة المحاولة."],
                        "Ecommerce|There has been an error. Our engineers are looking into it now. Please retry!": ["حدث خطأ. يعمل مهندسونا على حل المشكلة. الرجاء معاودة المحاولة."],
                        "Ecommerce|This             field is only needed if you activate by-weight shipping prices.             Otherwise, you can leave it blank. The customer will not see these             values.": ["هذا الحقل مطلوب فقط إذا قمت بفعيل أسعار الشحن بالوزن. خلاف ذلك ، يمكنك تركه فارغًا. لن يرى العميل هذه القيم."],
                        "Ecommerce|This Square account only accepts %{var1} and cannot accept %{var2}. Please disconnect this account first and then connect to another Square account or select %{var1} as your currency.": ["لا يقبل حساب Square هذا سوى%{var1} ولا يقبل %{var2}. يرجى فصل هذا الحساب أولاً ثم الاتصال بحساب Square آخر أو تحديد %{var1} كعملتك."],
                        "Ecommerce|This Strikingly Taiwan Payments account has been connected to another store. Please disconnect this account first, or use a different account.": ["حساب Strikingly Taiwan Payments هذا مربوط بمتجر آخر. الرجاء قطع اتصال هذا الحساب أولاً ، أو استخدام حساب مختلف."],
                        "Ecommerce|This action will reorder the display of all products in this category. These changes will be visible to visitors on your live site after you publish the site. Are you sure you want to change the display order for all products in this category?": ["سيعيد هذا الإجراء ترتيب عرض جميع المنتجات في هذه الفئة. ستكون هذه التغييرات مرئية للزوار على موقعك المباشر بعد نشر الموقع. هل أنت متأكد أنك تريد تغيير ترتيب العرض لجميع المنتجات في هذه الفئة؟"],
                        "Ecommerce|This category has already been added to this product.": ["تمت إضافة هذه الفئة إلى هذا المنتج."],
