                        "Ecommerce|We’ve upgraded our PayPal API. Please reconnect your PayPal account to ensure your payouts are not interrupted.": ["لقد قمنا  بتطوير PayPal API. يرجى إعادة توصيل حساب PayPal الخاص بك لضمان عدم مقاطعة مدفوعاتك."],
