                        "Ecommerce|You agree that you will not upload or sell any products or content which may be deemed hazardous, counterfeit, stolen, fraudulent, offensive or abusive.": ["أنت توافق على عدم تحميل أو بيع أي منتجات أو محتوى يمكن اعتباره خطيرًا أو مزيفًا أو مسروقًا أو احتياليًا أو مسيئًا."],
                        "Ecommerce|You are currently set up not to collect email addresses from customers at checkout. Your customers will not be able to receive review request emails and will not be able to submit product reviews. Please go to 'Checkout Form Settings' and check the box for collecting emails and set as required.": ['أنت مضبوط حاليًا على عدم جمع عناوين البريد الإلكتروني من العملاء عند الدفع. لن يتمكن عملاؤك من تلقي رسائل البريد الإلكتروني لطلب المراجعة ولن يتمكنوا من إرسال مراجعات المنتج. يرجى الانتقال إلى "إعدادات إستمارة الخروج" وتحديد المربع الخاص بجمع رسائل البريد الإلكتروني وتعيينها على النحو المطلوب.'],
                        "Ecommerce|You can accept payments in KRW but Stripe will convert to a supported payout currency.[link: Learn more]": ["يمكنك قبول المدفوعات بعملة إيغال كوريا الجنوبية ولكن سيتم تحويل Stripe إلى عملة مدفوعات مدعومة. [link: معرفة المزيد]"],
