                        "Ecommerce|You can close this dialog and continue working. The file will auto-download once the export is complete!": ["يمكنك إغلاق مربع الحوار هذا ومتابعة العمل. سيتم تحميل الملف تلقائيًا بمجرد اكتمال الاستخراج!"],
