                        "Editor|Are you sure you want to disconnect this domain? Your site will no longer be visible at %{domain}": ["هل أنت متأكد من أنك تريد قطع اتصال هذا النطاق؟ لن يكون موقعك مرئيًا بعد الآن على %{domain}"],
