                        "Editor|Due to industry standards, domain names with underscores (_) cannot receive public SSL certificates, which means they can't be accessed over HTTPS. We strongly recommend using a domain name without underscores.": ["نظراً للمعايير، لا يمكن للنطاقات التي تحتوي على شرطات سفلية ( _ ) تلقي شهادات الـ SSL العامة، مما يعني أنه لا يمكن الوصول إليها عبر ارتباط HTTPS. لذا نشدد على استخدام نطاق لا يحتوي على شرطة سفلية( _ )."],
