                        "Editor|Email Domain Authentication Failed. Please read [link1:these detailed instructions] and ensure the correct [link2:CNAME records] have been created. If you need more help, you can send this tutorial to your registrar's customer service or reach out to us for support!": ["لقد فشلت عملية توثيق نطاق البريد الإلكتروني. يرجى قراءة [link1: هذه التعليمات المفصلة] والتأكد من إنشاء [link2:التسجيلات CNAME] الصحيحة. إذا كنت بحاجة إلى مزيد من المساعدة، فيمكنك إرسال هذا الدليل إلى خدمة عملاء مسجل النطاق أو التواصل معنا للحصول على الدعم!"],
                        "Editor|Email Verification": ["التحقق من البريد الإلكتروني"],
                        "Editor|Email domain has been authenticated! Your emails will no longer show “via strikingly.com” in the From Name. [link:Learn more]": ['تم التصديق على نطاق البريد الإلكتروني! لن تظهر رسائل البريد الإلكتروني الخاصة بك بعد الآن «عبر strikingly.com» في "من طرف اسم". [link: اقرأ المزيد]'],
                        "Editor|Email domain has been authenticated. You can now send email campaigns.": ["تمت مصادقة نطاق البريد الإلكتروني. يمكنك الآن إرسال حملات البريد الإلكتروني."],
                        "Editor|Email domain is being authenticated. It may take up to 48 hours for [link:DNS records] to take effect. You'll see a status message here when the process is complete.": ["نطاق البريد الإلكتروني قيد التوثيق. قد يستغرق الأمر ما يصل إلى 48 ساعة حتى تدخل [link:سجلات DNS] حيز التنفيذ. سترى إشعاراً هنا عندما تكتمل العملية."],
                        "Editor|Email sent (%{var1}s)": ["تم إرسال البريد الإلكتروني (%{var1})"],
                        "Editor|Emails Sent": ["رسائل البريد الإلكتروني المرسلة"],
                        'Editor|Emails that are sent from our platform but labeled with a free email address (Gmail, Yahoo, Hotmail, etc) are more likely to be marked as spam or junk. Instead, we recommend using a custom domain email for "From Email."': ['رسائل البريد الإلكتروني المرسلة من مزود بريد إلكتروني مجاني مثل (Gmail وYahoo وHotmail وما إلى ذلك) عبر منصتنا قد يتم تصنيفها على أنها بريد عشوائي أو غير مرغوب فيه. لذلك، نوصي باستخدام بريد إلكتروني مخصص في حقل "بريد المُرسِل".'],
