                        "Editor|Enable invisible hCaptcha to all forms, which is a basic safeguard to protect your web forms from spammers. The invisible hCaptcha won't affect your form style and only triggers the test when a suspicious visitor (e.g. robot) submits a form.": ["تفعيل خدمة hCaptcha غير المرئية لجميع الاستمارات، وهي حماية أساسية لاستماراتك من مرسلي البريد العشوائي. لن تؤثر خدمة hCaptcha غير المرئية على مظهر الاستمارة، وسيفعّل الاختبار عندما يقوم زائر مشبوه (مثل الروبوت) بملء الاستمارة."],
