                        "Editor|Here are the top ranked search results for your target keyword. To achieve high ranking potential, we recommend your title to imitate these to best match the search intent.": ["فيما يلي أفضل نتائج البحث لكلمتكم الرئيسية المستهدفة. لتوفير إمكانيات تصنيف أعلى، نوصي أن يشابه عنوانكم هذه العناصر لتتناسب بشكل أفضل مع البحث المستهدف."],
