                        "Editor|However, we strongly recommend using a custom domain email (e.g. hello@yourdomain.com) for From Email, which builds trust with recipients and looks more professional. [link:Get a custom email].": ["ومع ذلك ، نوصي بشدة باستخدام بريد إلكتروني مخصص للنطاق (على سبيل المثال hello@yourdomain.com) ل From Email ، والذي يبني الثقة مع المستلمين ويبدو أكثر احترافية. [link:الحصول على بريد إلكتروني مخصص]."],
                        "Editor|I already have a site in this language": ["لدي بالفعل موقع بهذه اللغة"],
