                        "Editor|I understand that all collected info is the responsibility of the site owner, and that the platform has right to remove the illegal content.": ["افهم أن جميع المعلومات التي تم جمعها هي من مسؤولية صاحب الموقع، وأن منصة لديه الحق في إزالة محتوى غير قانوني."],
