                        "Editor|If empty, we'll fill it in with the category name.": ["إذا كان فارغا، فسنملأه باسم الفئة."],
                        "Editor|If not, your blog post with your custom HTML code will be reviewed by our system before going live. (Before submitting, please [link:preview your blog post] to make sure your code works.)": ["عِوضاً عن ذلك، سيقوم نظامنا بمراجعة منشور المدونة بالإضافة إلى كود الـ HTML المخصص قبل نشر الموقع. (قبل الإرسال، يُرجى [link: معاينة موقعك] للتأكد من أن نصك البرمجي يعمل.)"],
                        "Editor|If not, your custom code will be reviewed by our system before going live. (Before submitting, please [link:go to Blog Posts] and preview them to make sure your code works.)": ["عوضاً عن ذلك، سيتم مراجعة الكود المخصص الخاص بك من قبل نظامنا قبل بثه مباشرة. (قبل الإرسال، يرجى [link:الذهاب إلى منشورات المدونة] ومعاينتها للتأكد من عمل الكود.)"],
                        "Editor|If not, your custom code will be reviewed by our system before going live. (Before submitting, please [link:preview your site] to make sure your code works.)": ["عوضاً عن ذلك، سيتم مراجعة الكود المخصص الخاص بك من قبل نظامنا قبل بثه مباشرة. (قبل الإرسال، يرجى [link: معاينة موقعك] للتأكد من عمل الكود.)"],
                        "Editor|If not, your site with your custom HTML code will be reviewed by our system before going live. (Before submitting, please [link:preview your site] to make sure your code works.)": ["عِوضاً عن ذلك، سيقوم نظامنا بمراجعة موقعك بالإضافة إلى كود الـ HTML المخصص قبل نشر الموقع. (قبل الإرسال، يُرجى [link: معاينة موقعك] للتأكد من أن نصك البرمجي يعمل.)"],
                        "Editor|If you already own a domain, [link:click here to connect.]": ["إذا كنت تمتلك نطاقا ، [link: انقر هنا للربط.]"],
                        "Editor|If you already own a domain, enter it here.": ["إن كنت تملك نطاقاً خاصاً، المرجو إدخاه هنا"],
                        "Editor|If you change this [strong1: Blog section] to a [strong2: %{var1} section], all blog features will be removed in this section. Visitors will not be able to view each blog post in a new page.": ["إذا قمت بتغيير هذا [strong1: قسم المدونة] إلى [strong2: %{var1} قسم]، ستتم إزالة جميع ميزات المدونة في هذا القسم. لن يتمكن الزوار من عرض كل مقالة مدونة في صفحة جديدة."],
                        "Editor|If you change this [strong1: Booking section] to a [strong2: %{var1} section], all booking features will be removed in this section. Visitors will not be able to book appointments.": ["إذا قمت بتغيير هذا [strong1: قسم الحجز] إلى قسم [strong2: %{var1}]، ستتم إزالة جميع ميزات الحجز في هذا القسم. لن يتمكن الزوار من حجز المواعيد."],
                        "Editor|If you change this [strong1: Portfolio section] to a [strong2: %{var1} section], all showcase features will be removed in this section. Visitors will not be able to view each item in a new page with more details.": ["إذا قمت بتغيير هذا [strong1: قسم المحفظة] إلى [strong2: %{var1}] قسم، ستتم إزالة جميع ميزات العرض في هذا القسم. لن يتمكن الزوار من عرض كل عنصر في صفحة جديدة تحتوي على مزيد من التفاصيل."],
                        "Editor|If you change this [strong1: Store section] to a [strong2: %{var1} section], all store features will be removed in this section. Visitors will not be able to place orders or make payments.": ["إذا قمت بتغيير هذا [strong1: قسم المتجر] إلى قسم [strong2: %{var1}]، ستتم إزالة جميع ميزات المتجر في هذا القسم. لن يتمكن الزوار من تقديم الطلبات أو إجراء عمليات الدفع."],
                        "Editor|If you choose to include custom images, please make sure all images are relevant to your site content. We'll use these images in your site where appropriate.": ["إذا اخترت تضمين صور مخصصة، فيرجى التأكد من أن جميع الصور ذات صلة بمحتوى موقعك. سنستخدم هذه الصور في موقعك حيثما كان ذلك مناسبًا."],
                        "Editor|If you edit the logo, [strong:the current design will be overwritten.] Existing sites will not be changed. Are you sure you want to edit?": ["إذا قمت بتعديل الشعار، [strong: سيتم الكتابة فوق التصميم الحالي.] لن يتم تغيير المواقع الحالية. هل أنت متأكد من رغبتك في التعديل؟"],
                        "Editor|If you have a set of custom images you'd like to use, please include them in a Zip file and upload them here. (Max filesize: %{storageSize}MB total, up to %{maxLength} images)": ["إذا كان لديك مجموعة من الصور المخصصة التي ترغب في استخدامها، يرجى تضمينها في ملف مضغوط وتحميلها هنا. (الحد الأقصى لحجم الملفات: %{storageSize}ميجابايت، حتى %{maxLength} الصور)"],
                        "Editor|If you have specific requirements for generating content, add custom commands here. Otherwise, we recommend leaving this blank for best results.": ["إذا كانت لديكم متطلبات محددة لإنشاء المحتوى، فقوموا بإضافة أوامر مخصصة هنا. خلاف ذلك، نُوصي بترك هذه المساحة فارغة للحصول على أفضل النتائج."],
                        "Editor|If you save & overwrite, the previous logo design will no longer be selectable. Or you can save as copy to keep multiple versions.": ["المحرر |إذا قمت بالحفظ والاستبدال، لن يكون تصميم الشعار السابق قابلاً للتحديد أو يمكنك الحفظ كنسخة للاحتفاظ بنسخ متعددة."],
                        "Editor|If you want to set all item buttons uniformly, go to [link:Portfolio Settings].": ["إذا كنت تريد تعيين جميع أزرار العناصر بشكل موحد ، فانتقل إلى [link:إعدادات المحفظة]"],
                        "Editor|If you're using a third-party domain to send emails, you must authenticate your domain before you can send from this address.": ["إذا كنت تستخدم نطاقا تابعا لجهة خارجية لإرسال رسائل بريد إلكتروني، فيجب عليك توثيق نطاقك قبل التمكن من الإرسال باستخدام هذا العنوان."],
                        "Editor|If your domain is hosted on Strikingly, your domain is automatically authenticated -- no action needed.": ["إذا تم استضافة نطاقك على Strikingly، يتم مصادقة نطاقك تلقائيًا - لا حاجة إلى أي إجراء."],
                        "Editor|Ignore & use mobile browser": ["تجاهل واستخدم متصفح الجوال"],
                        "Editor|Image": ["صورة"],
                        'Editor|Image "alt text" help search engines identify the content of images and help screen-reading tools describe images to visitors': ["النص البديل للصورة تساعد محركات البحث في التعرف على محتوى الصور وتساعد أدوات قراءة الشاشة في وصف الصور للزوار"],
                        'Editor|Image "alt text" helps search engines identify the content of images and help screen-reading tools describe images to visitors. Try to add short, human-readable terms for each image from the site pages and sections.': ["النص البديل للصورة يساعد محركات البحث في التعرف على محتوى الصور وتساعد أدوات قراءة الشاشة في وصف الصور للزوار. حاول إضافة مصطلحات قصيرة وسهلة القراءة لكل صورة من صفحات وأقسام الموقع."],
