                        "Editor|Tell us a bit about your business and we'll generate a full site just for you.": ["أخبرنا قليلاً عن عملك وسننشئ موقعاً كاملاً خصيصاً لك."],
                        "Editor|Tell us a bit about your business and we'll generate logos for you to choose from.": ["أخبرنا قليلاً عن عملك وسنقوم بإنشاء شعارات لتختار من بينها."],
                        "Editor|Tell us what you want to write about, and our AI will find the best search keywords for getting traffic. Then we'll write an original SEO-optimized article (up to 3000 words) in minutes.": ["أخبرونا بما تودون الكتابة عنه، وسيقوم الذكاء الاصطناعي بالعثور على أفضل كلمات البحث الرئيسية للحصول على زيارات أكثر. بعد ذلك سنقوم بكتابة مقالة أصلية ومُحسّنة لتحسين الترتيب على محركات البحث (بما يصل إلى 3000 كلمة) في بضعة دقائق."],
                        "Editor|Templates failed to load.": ["فشل تحميل القوالب."],
