                        "Editor|This blog post is being edited": ["يتم تحرير منشور المدونة هذا"],
                        "Editor|This button will open the Portfolio Visitor Form.": ["سيفتح هذا الزر استمارة زائر الملف التعريفي."],
                        "Editor|This choice helps define the look and feel of your brand. You can change this at any time.": ["يساعد هذا الاختيار في تحديد شكل ومظهر علامتك التجارية. يمكنك تغيير هذا في أي وقت."],
                        "Editor|This command will only take effect when generating post body.": ["لن يسري هذا الأمر إلا عند تكوين نص المنشور."],
                        "Editor|This command will only take effect when generating post outline.": ["لن يسري هذا الأمر إلا عند تكوين مخطط للنشر."],
                        "Editor|This command will only take effect when generating post title.": ["لن يسري هذا الأمر إلا عند تكوين عنوان المنشور."],
                        "Editor|This domain name format is incorrect. Please check again!": ["تنسيق اسم النطاق هذا غير صحيح. يرجى التحقق مرة أخرى!"],
                        "Editor|This domain seems to be connected to a different service or site. To connect this domain to this site, we’ll automatically update your DNS records, but this may affect existing connected services. Are you sure you want to connect this domain to this site?": ["يبدو أن هذا المجال متصل بخدمة أو موقع مختلف. لربط هذا النطاق بهذا الموقع ، سنقوم تلقائيًا بتحديث سجلات DNS الخاصة بك ، ولكن هذا قد يؤثر على الخدمات المتصلة الحالية. هل أنت متأكد أنك تريد ربط هذا المجال بهذا الموقع؟"],
                        "Editor|This element is only available for Pro sites. Upgrade your account to unlock this element!": ["هذا العنصر متاح فقط لمواقع Pro. قم بترقية حسابك لفتح هذا العنصر!"],
