                        "Editor|This form will be shown when the visitor: [var1]. Add up to [var2] custom fields to collect email, phone, or other info from potential customers. (Visitors only need to fill form once.)": ["ستظهر هذه الاستمارة للزائر: [var1] . إضافة ما يصل إلى[var2] من الحقول المخصصة لجمع البريد الإلكتروني أو الهاتف أو المعلومات الأخرى من العملاء المحتملين. (يحتاج الزوار إلى ملء الاستمارة مرة واحدة فقط)."],
                        "Editor|This image is too tall! Please upload a banner with a wider aspect ratio.": ["هذه الصورة طويلة جدًا! يرجى تحميل لافتة ذات نسبة عرض إلى ارتفاع أكبر."],
                        "Editor|This is a Pro feature. You can try it out but will need to remove it before you publish the site.": ["هذه خاصية Pro. يمكنك تجربته ولكنك ستحتاج إلى إزالته قبل نشر الموقع."],
                        "Editor|This is a legacy feature. Please set buttons uniformly for all items in [var3].": ["هذه ميزة قديمة. الرجاء تعيين الأزرار بشكل موحد لجميع العناصر في [var3]."],
                        "Editor|This is an irreversible action! An email notification will be sent to this registered attendee about the cancellation. Are you sure you want to cancel this event?": ["هذا إجراء لا رجوع فيه! سيتم إرسال إشعار بالبريد الإلكتروني إلى هذا الحاضر المسجل بخصوص الإلغاء. هل أنت متأكد أنك تريد إلغاء هذا الحدث؟"],
                        "Editor|This is only a preview. Actual Google search results may differ from what is shown here.": ["هذه ليست سوى معاينة. قد تختلف نتائج بحث Google الفعلية عما هو معروض هنا."],
                        "Editor|This is the description that displayed in the search result.": ["هذا هو الوصف الذي يظهر على نتيجة البحث."],
                        "Editor|This is the home page": ["هذه هي الصفحة الرئيسية"],
                        "Editor|This is useful if you need to export this data in a format that requires separate first and last names.": ["يوصى به إذا كنتم بحاجة إلى تصدير هذه البيانات بتنسيق يتطلب أن يكون الاسم الشخصي واسم العائلة منفصلين."],
                        "Editor|This logo design is currently being used in %{var1} sites (%{siteNames}).": ["يتم استخدام تصميم الشعار هذا حالياً في %{var1} المواقع (%{siteNames})."],
                        "Editor|This logo design is currently being used in %{var1} sites (%{siteNames}[text:...]).": ["المحرر يتم استخدام تصميم الشعار هذا حالياً في %{var1} المواقع (%{siteNames}[text:...])."],
                        "Editor|This logo design is currently being used in your site (%{siteNames}).": ["هذا تصميم الشعار مستخدم حالياً في موقعك (%{siteNames})."],
                        "Editor|This logo is currently used in %{var1} sites (%{siteNames}).": ["هذا الشعار مستخدم حالياً في %{var1} مواقع (%{siteNames})."],
                        "Editor|This logo is currently used in %{var1} sites (%{siteNames}[text:...]).": ["هذا الشعار مستخدم حالياً في  %{var1} المواقع  (%{siteNames}[text:...])."],
                        "Editor|This logo is currently used in your site (%{siteNames}).": ["هذا الشعار مستخدم حالياً في موقعك (%{siteNames})."],
