                        "Editor|This page is hidden in the navigation menu": ["هذه الصفحة مخفية في قائمة التنقل"],
                        "Editor|This page is only accessible to members who purchased a specific product.": ["هذه الصفحة متاحة فقط للأعضاء الذين اشتروا منتجًا معينًا."],
                        "Editor|This page is only accessible to paid members.": ["هذه الصفحة متاحة فقط للأعضاء بالدفع."],
