                        "Editor|This page is password-protected.": ["هذه الصفحة محمية بكلمة مرور."],
                        "Editor|This record doesn’t exist. In your DNS settings, you must add a CNAME record with the correct name and value.": ["هذا السجل غير موجود. في إعدادات DNS الخاصة بك، يجب إضافة سجل CNAME بالاسم والقيمة الصحيحين."],
                        "Editor|This record doesn’t exist. In your DNS settings, you must add an A record with the correct name and value.": ["هذا السجل غير موجود. في إعدادات DNS الخاصة بك، يجب إضافة سجل A بالاسم والقيمة الصحيحين."],
                        "Editor|This record is setup correctly already!": ["تم إعداد هذا السجل بشكل صحيح سابقاً!"],
                        "Editor|This record was not found in the DNS settings for %{domain}. You must add a TXT record with the correct name and value. (If you've already added this, click the button to check again.)": ["لم يتم العثور على هذا السجل في إعدادات DNS ل %{domain}. يجب إضافة سجل TXT بالاسم والقيمة الصحيحين. (إذا كنت قد أضفت هذا بالفعل ، فانقر فوق الزر للتحقق مرة أخرى.)"],
                        "Editor|This section does not include online payments. If you want to take payments, please use the Store section instead.": ["لا يتضمن هذا القسم عمليات الدفع عبر الإنترنت. إذا كنت تريد تلقي الدفعات، فيرجى استخدام قسم المتجر بدلاً من ذلك."],
                        "Editor|This section has been customized! Reset this section to start over with the original layout and content.": ["تم تخصيص هذا القسم! أعد تعيين هذا القسم للبدء من جديد بالتخطيط والمحتوى الأصليين."],
