                        "Editor|This section is only available for Pro sites. Upgrade your account to unlock this section!": ["هذا القسم متاح فقط لمواقع Pro. قم بترقية حسابك لفتح هذا القسم!"],
                        "Editor|This section is only visible in desktop view and is hidden on mobile view.": ["سيظهرهذا القسم في عرض جهاز الحاسوب فقط وسيكون مخفياً في عرض الجوال."],
                        "Editor|This section is only visible in mobile view and is hidden on desktop view.": ["سيظهرهذا القسم في عرض الجوال فقط وسيكون مخفياً في عرض جهاز الحاسوب."],
                        "Editor|This site already has a Store section. Are you sure you want to add another Store section?": ["هذا الموقع يحتوي على قسم المتجر. هل أنت متأكد أنك تريد إضافة قسم متجر آخر؟"],
                        "Editor|This site editor is currently opened on another browser tab of yours. If you start editing here, the unsaved changes on the other tab will be lost! [strong:Are you sure you want to take over?]": ["محرر الموقع هذا مفتوح حاليا على تبويب متصفح آخر يخصك. إذا بدأت التحرير هنا فكل التغييرات على تبويب المتصفح الآخر ستضيع! [strong:أمتأكد من أنك تريد تولي التحكم؟]"],
                        "Editor|This site has been deleted.": ["تم حذف هذا الموقع."],
                        "Editor|This site is currently using the following premium features:": ["يستخدم هذا الموقع حاليًا الميزات Pro التالية:"],
                        "Editor|This site's logos": ["شعارات هذا الموقع"],
