                        "Editor|To comply with email regulations and avoid having your emails marked as spam or bounced, it's important to use a domain email address authenticated with DKIM. We highly recommend completing DKIM authentication before sending emails to ensure successful delivery.": ["للالتزام بلوائح البريد الإلكتروني وتجنب وضع علامة على رسائلك الإلكترونية كرسائل غير مرغوب فيها أو مرتدة، من المهم استخدام عنوان بريد إلكتروني للنطاق تمت مصادقته باستخدام DKIM. نوصي بشدة بإكمال مصادقة DKIM قبل إرسال رسائل البريد الإلكتروني لضمان التسليم الناجح."],
                        "Editor|To edit your From Email, please go to [link:Settings - Email Notification].": ['لتعديل "من البريد الإلكتروني" ، يرجى الانتقال إلى [link:Settings - Email Notification].'],
                        "Editor|To improve the SEO ranking of this post, we strongly recommend adding internal links in your related posts that link to this post. Here are the related posts that we can link to this article, and the keywords we’ll add the links on:": ["نوصي بإضافة روابط داخلية إلى المنشورات ذات الصلة التي ترتبط بهذا المنشور، لتحسين تصنيفه في محرّكات البحث. فيما يلي المنشورات ذات الصلة التي يمكننا ربطها بهذا المقال، ثم الكلمات الرئيسية التي سنضيف الروابط عليها"],
