                        "Editor|WARNING: This will keep your home page and hide all other pages. Don't worry, you can always activate Multiple Pages again to restore them.\nAre you sure you wish to continue?": ["تحذير: سيؤدي هذا إلى الاحتفاظ بصفحتك الرئيسية وإخفاء جميع الصفحات الأخرى. لا تقلق ، يمكنك دائماً تفعيل صفحات متعددة مرة أخرى لاستعادتها\n هل أنت متأكد من أنك تريد المتابعة؟"],
