                        'Editor|We highly recommend using a computer for editing! Please enter the URL [url: "SXL.CN"] in your browser to access the desktop editor.': ['نوصي بشدة باستخدام جهاز كمبيوتر للتحرير! الرجاء إدخال عنوان URL [url: "SXL.CN"] في متصفحك للوصول إلى محرر سطح المكتب.'],
