                        "Editor|We now support simultaneous editing for multiple teammates on the same site! Invite your teammates and edit sites together seamlessly.": ["نحن ندعم الآن التحرير المتزامن لعدة زملاء في نفس الموقع! قم بدعوة زملائك في الفريق وتعديل المواقع معًا بسلاسة."],
