                        "Editor|We're regularly checking your domain status. This can take up to %{time} hours. Or you can click the button to check again manually.": ["نحن نتحقق بانتظام من حالة نطاقك. قد يستغرق هذا ما يصل إلى %{time} ساعات. أو يمكنك النقر فوق الزر للتحقق مرة أخرى يدويا."],
                        "Editor|We've ensured each keyword is used repeatedly in the article for the best SEO performance. Hover on each keyword to see where it's used.": ["لقد تأكدنا من استخدام كل كلمة رئيسية بشكل متكرر في المقالة للحصول على أفضل أداء لتحسين الترتيب على محركات البحث. قوموا بالمرور فوق كل كلمة رئيسية لمعرفة مكان استخدامها."],
                        "Editor|We've written 5 article titles for your topic & selected keywords. Please select a title to continue writing the blog outline.": ["لقد قمنا بكتابة 5 عناوين مقالات لموضوعك وكلمات رئيسية مختارة. الرجاء تحديد عنوان لمتابعة كتابة مخطط المدونة."],
