                        "Editor|Welcome to AI SEO Writer": ["مرحباً بكم في برنامج الكتابة باستخدام الذكاء الاصطناعي لتحسين الترتيب على محركات البحث"],
                        "Editor|Welcome to Site Editor": ["مرحبًا بك في محرر الموقع"],
