                        "Editor|We’re checking your DNS records. This may take up to %{time} seconds.": ["نحن نتحقق من سجلات DNS الخاصة بك. قد يستغرق هذا ما يصل إلى %{time} ثانية."],
                        "Editor|We’ve upgraded the editor with more features at your fingertips! Your Mini-Program content hasn't changed. If you have any trouble, please contact support anytime.": ["لقد قمنا بتطوير المحرر بمزيد من الميزات في متناول يدك! لم يتغير محتوى Mini Program الخاص بك. إذا كان لديك أي مشكلة ، يرجى الاتصال بالدعم في أي وقت."],
                        "Editor|We’ve upgraded the editor with more features at your fingertips! Your site content hasn't changed. If you have any trouble, please contact support anytime.": ["لقد قمنا بتطوير المحرر بمزيد من الميزات في متناول يدك! لم يتغير محتوى موقعك. إذا كان لديك أي مشكلة ، يرجى الاتصال بالدعم في أي وقت."],
                        "Editor|What's your business type?": ["ما هو نوع عملك؟"],
                        "Editor|When enabled, show a reCAPTCHA checkbox on the form, which provides strong protection against bots submitting spam.": ["عند التفعيل، سيظهر مربع اختيار reCAPTCHA على الاستمارة، والذي يوفر حماية قوية ضد برامج الروبوتات التي ترسل رسائل غير مرغوب بها."],
                        "Editor|When publishing as a free site, premium features will be disabled.": ["عند النشر كموقع مجاني، سيتم تعطيل الميزات المحترفة."],
                        "Editor|When user has not purchased after adding to cart for": ["عندما لا يشتري المستخدم بعد الإضافة إلى عربة التسوق لـمدة"],
                        "Editor|When you have done editing, you can click here to back to dashboard to preview your site content.": ["عندما تنتهي من التحرير ، يمكنك النقر هنا للعودة إلى لوحة التحكم لمعاينة محتوى موقعك."],
                        "Editor|White Minimal": ["ابيض بسيط"],
                        "Editor|Who’s editing this site:": ["من يقوم بتعديل هذا الموقع:"],
                        "Editor|Why?": ["لماذا؟"],
                        "Editor|Wide": ["واسع"],
                        "Editor|Wide - 16:9": ["واسع - 16:9"],
                        "Editor|Width": ["العرض"],
                        "Editor|Winter Collection": ["مجموعة الشتاء"],
