                        "Visitors can click on buttons to move to the next/previous section.": ["يمكن للزوار النقر فوق الأزرار للانتقال إلى القسم التالي / السابق."],
                        "Visitors must agree to this before form submission.": ["يجب على الزوار الموافقة على هذا قبل تقديم الاستمارة."],
                        "WRITE NEW POST": ["اكتب مشاركة جديدة"],
                        "Want to get started quickly? Convert your LinkedIn profile into a beautiful personal website in just one click!": ["تريد أن تبدأ بسرعة؟ قم بتحويل ملفك الشخصي على LinkedIn إلى موقع شخصي جميل بنقرة واحدة فقط!"],
                        "We are still preparing %{address} to send newsletters. Please allow up to 24 hours for processing": ["ما زلنا نجهز %{address} لإرسال رسائل إخبارية. يرجى السماح بما يصل إلى 24 ساعة للمعالجة"],
                        "We strongly recommend that you turn this on. You’ll receive desktop notifications as long as your browser is open (even if it’s not on Strikingly.com). Click the notification to open a chat window and reply instantly.": ["نوصي بشدة بتشغيل هذا. ستتلقى إشعارات سطح المكتب طالما كان متصفحك مفتوحًا (حتى لو لم يكن موجودًا على Strikingly.com). انقر فوق الإشعار لفتح نافذة الدردشة والرد على الفور."],
                        "We strongly recommend uploading a headshot to increase engagement.": ["نوصي بشدة بتحميل صورتك لزيادة المشاركة."],
                        "We're not available right now, but please send us a message and we’ll get back to you as soon as possible!": ["لسنا متاحين الآن ، ولكن يُرجى إرسال رسالة إلينا وسنعاود الاتصال بك في أقرب وقت ممكن!"],
                        "We're sorry, but you've sent too many requests. Please try again later.": ["نحن آسفون ، لكنك أرسلت الكثير من الطلبات. الرجاء معاودة المحاولة في وقت لاحق."],
                        "We've just added some updates to our editor. Click the button below to get the latest changes!": ["لقد أضفنا للتو بعض التحديثات إلى محررنا. انقر فوق الزر أدناه للحصول على أحدث التغييرات!"],
